window.bookSummaryJSON = "<p><b>She ruined everything.... I will make her pay.</b></p> <p>Her mom robbed my dad of his job. Destroyed his life.</p> <p>Now I have to look at her every day.</p> <p>The girl next door. A human. A hot little nerd.</p> <p>She doesn’t belong here - not in Wolf Ridge, not at our high school, definitely not in my life.</p> <p>She doesn’t know what I am.</p> <p>Which makes it all the easier to take revenge.</p> <p>I will bring her to her knees. Pierce her heart.</p> <p>Make her bleed. For me.</p> <p>All for me.</p> <p><b><i>USA Today</i></b><b> best-selling author Renee Rose delivers on this intense new adult shifter bully romance.</b></p>"; 
